server <- function(input, output, session) {
  
  # Reactive values for data storage
  fetched_data <- reactiveVal(list())
  status <- reactiveVal("SYSTEM: READY")
  
  # Dynamic Matrix Rendering (5 Columns x 2 Rows)
  output$strand_matrix <- renderUI({
    n <- as.numeric(input$num_strands)
    strand_indices <- 1:n
    rows_data <- split(strand_indices, ceiling(seq_along(strand_indices) / 5))
    
    tagList(
      lapply(rows_data, function(row_indices) {
        fluidRow(
          lapply(row_indices, function(i) {
            column(width = 2,
              div(class = "strand-col",
                textInput(paste0("strand_title_", i), label = NULL, value = paste("STRAND", i)),
                textAreaInput(paste0("strand_ids_", i), label = NULL, placeholder = "Paste IDs...", rows = 8)
              )
            )
          })
        )
      })
    )
  })
  
  # Update Export Button Label
  observe({
    ext <- tolower(input$export_format)
    label <- sprintf("EXPORT XTRACT (.%s)", ext)
    runjs(sprintf("$('#btn_export').text('%s')", label))
  })
  
  # Status Text
  output$status_text <- renderText({ status() })
  
  # Clear All
  observeEvent(input$btn_clear, {
    n <- as.numeric(input$num_strands)
    for(i in 1:n) {
      updateTextAreaInput(session, paste0("strand_ids_", i), value = "")
      updateTextInput(session, paste0("strand_title_", i), value = paste("STRAND", i))
    }
    status("SYSTEM: WORKSPACE CLEARED")
  })
  
  # CSV Import
  observeEvent(input$csv_file, {
    req(input$csv_file)
    df <- read.csv(input$csv_file$datapath, stringsAsFactors = FALSE)
    n_csv <- ncol(df)
    
    updateSelectInput(session, "num_strands", selected = min(max(n_csv, 5), 10))
    
    delay(500, {
      for(i in 1:min(n_csv, 10)) {
        col_name <- colnames(df)[i]
        ids <- df[[i]] %>% na.omit() %>% as.character() %>% paste(collapse = "\n")
        updateTextInput(session, paste0("strand_title_", i), value = col_name)
        updateTextAreaInput(session, paste0("strand_ids_", i), value = ids)
      }
    })
    status("SYSTEM: DATA IMPORTED FROM CSV")
  })
  
  # Xtract Logic
  observeEvent(input$btn_xtract, {
    n <- as.numeric(input$num_strands)
    all_results <- list()
    
    withProgress(message = 'Harvesting Sequences...', value = 0, {
      for(i in 1:n) {
        title <- input[[paste0("strand_title_", i)]]
        ids_raw <- input[[paste0("strand_ids_", i)]]
        ids <- unlist(strsplit(ids_raw, "[\n, ]+"))
        ids <- ids[ids != ""]
        
        if(length(ids) == 0) next
        
        status(sprintf("SYSTEM: FETCHING %s...", toupper(title)))
        incProgress(1/n, detail = title)
        
        # Batch Fetch logic (matching Python logic)
        tryCatch({
          id_list <- paste(ids, collapse = ",")
          rettype <- ifelse(input$export_format == "FASTA", "fasta", "fastq")
          
          url <- sprintf("https://eutils.ncbi.nlm.nih.gov/entrez/eutils/efetch.fcgi?db=%s&id=%s&rettype=%s&retmode=text",
                         input$db_type, id_list, rettype)
          
          res <- GET(url, timeout(12))
          if(status_code(res) == 200) {
            all_results[[title]] <- content(res, as = "text")
          }
        }, error = function(e) {
          status(sprintf("ERROR: %s failed", title))
        })
      }
    })
    
    fetched_data(all_results)
    if(length(all_results) > 0) {
      status("SYSTEM: HARVEST COMPLETE. READY TO EXPORT.")
      shinyjs::enable("btn_export")
    } else {
      status("SYSTEM: NO DATA FOUND")
    }
  })
  
  # Export Handler
  output$btn_export <- downloadHandler(
    filename = function() {
      paste0("FASTA-Xtract-Harvest-", format(Sys.time(), "%Y%m%d-%H%M"), ".zip")
    },
    content = function(file) {
      data_list <- fetched_data()
      ext <- ifelse(input$export_format == "FASTA", ".fasta", ".fastq")
      
      tmp_dir <- tempdir()
      files_to_zip <- c()
      
      for(name in names(data_list)) {
        safe_name <- gsub("[^[:alnum:]]", "_", name)
        file_path <- file.path(tmp_dir, paste0(safe_name, ext))
        writeLines(data_list[[name]], file_path)
        files_to_zip <- c(files_to_zip, file_path)
      }
      
      zip::zipr(file, files = files_to_zip)
    }
  )
}

shinyApp(ui, server)
